    for (let i = 0; i < 4; i++) {
      cardItemUIs.push(
        <div className="card col-xl-3 col-lg-3 col-md-3">
          <image className="card-img-top cardItem" src={urlImage} alt="..." />
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </p>
            <div className="btn btn-primary">Fill Out More</div>
          </div>
        </div>
      );
    }
return  };
  render() {
    return (
      <div className="items">
        <div className="row container">
          {this.renderItem()}
        </div>
      </div>
    );
  }
}

export default Item;
